import './App.css';
import Firstpage from './Firstpage';
function App() {
  return (
    <html>
      <title>First react page</title>
      <body>
        <div>
          <h1>Laxmana Rao!</h1>
          <Firstpage/>;
        </div>
      </body>
    </html>
  );
}

export default App;
